  const [checked, setChecked] = React.useState(true);

  return (
    <div style={{ marginLeft: "300px", backgroundColor: "pink" }}>
      <h1>Dashboard Screen</h1>
      <UseAnimations
        animation={github}
        size={56}
        wrapperStyle={{ padding: 100 }}
      />
    </div>
  );
}
